import React from 'react';
import { Search, Bell, Clock, MapPin } from 'lucide-react';

const Dashboard = ({ user, events, theme, regCount }) => {
  const isDark = theme === 'dark';

  const styles = {
    container: { padding: '16px', paddingBottom: '100px' },
    header: { display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: '20px' },
    brand: { display: 'flex', alignItems: 'center', gap: '10px' },
    logo: { width: '40px', height: '40px', borderRadius: '50%', backgroundColor: '#2563eb', color: '#fff', display: 'flex', justifyContent: 'center', alignItems: 'center', fontWeight: 'bold' },
    greeting: { fontSize: '32px', fontWeight: 'bold', margin: '10px 0 5px 0', color: isDark ? '#fff' : '#1e293b' },
    subText: { color: isDark ? '#94a3b8' : '#64748b', fontSize: '14px', marginBottom: '24px' },
    statsRow: { display: 'flex', gap: '12px', marginBottom: '24px' },
    // Stats cards with white background as per
    statCard: { flex: 1, backgroundColor: '#fff', padding: '16px', borderRadius: '16px', color: '#1e293b' },
    eventCard: { 
      border: isDark ? '1px solid #334155' : '1px solid #f1f5f9', 
      borderRadius: '20px', 
      padding: '12px',
      backgroundColor: isDark ? 'transparent' : '#fff' 
    },
    regBtn: { width: '100%', backgroundColor: '#2563eb', color: '#fff', border: 'none', padding: '12px', borderRadius: '12px', fontWeight: 'bold', marginTop: '12px' }
  };

  return (
    <div style={styles.container}>
      <header style={styles.header}>
        <div style={styles.brand}>
          <div style={styles.logo}>ES</div>
          <span style={{ fontWeight: 'bold', fontSize: '18px', color: isDark ? '#94a3b8' : '#1e293b' }}>EventSphere</span>
        </div>
        <div style={{ display: 'flex', gap: '15px', color: isDark ? '#94a3b8' : '#1e293b' }}>
          <Search size={24} />
          <Bell size={24} />
        </div>
      </header>

      <h1 style={styles.greeting}>Hi ðŸ‘‹</h1>
      <p style={styles.subText}>Explore college events</p>

      <div style={styles.statsRow}>
        <div style={styles.statCard}>
          <div style={{ fontSize: '12px', color: '#64748b' }}>Upcoming</div>
          <div style={{ fontSize: '24px', fontWeight: 'bold' }}>{events.length}</div>
        </div>
        <div style={styles.statCard}>
          <div style={{ fontSize: '12px', color: '#64748b' }}>Registered</div>
          <div style={{ fontSize: '24px', fontWeight: 'bold' }}>{regCount}</div>
        </div>
      </div>

      <h3 style={{ color: isDark ? '#94a3b8' : '#1e293b', marginBottom: '16px' }}>Upcoming Events</h3>
      
      {events.map(event => (
        <div key={event.id} style={styles.eventCard}>
          <div style={{ height: '180px', backgroundColor: '#1e293b', borderRadius: '12px', marginBottom: '12px' }}></div>
          <h4 style={{ margin: '0 0 8px 0', color: isDark ? '#fff' : '#1e293b' }}>{event.title}</h4>
          <div style={{ display: 'flex', alignItems: 'center', gap: '5px', fontSize: '12px', color: '#94a3b8', marginBottom: '4px' }}>
            <Clock size={14} /> {event.date}
          </div>
          <div style={{ display: 'flex', alignItems: 'center', gap: '5px', fontSize: '12px', color: '#94a3b8' }}>
            <MapPin size={14} /> {event.location}
          </div>
          <button style={styles.regBtn}>Register</button>
        </div>
      ))}
    </div>
  );
};

export default Dashboard;
